import React from 'react';
import Navbar from './Navbar';


const About = ()=>{
    return(
        <>
        <Navbar />

            <div className='container' style={{backgroundColor:'royalblue',
            margin}}>
                <h1 align='center'> About Us</h1>
            </div>
        </>
    )
}
export default About;
